const List = ({todos, deleteTodo}) => {

    const complete = (e) => {
        const id = e
        deleteTodo()
    };
    return (
    <div>
        {todos.map(todo => {
            return (
                <div key={todo.id}>
                    <button onClick={complete}>完了</button>
                    <span>{todo.content}</span>
                    <h2></h2>
                </div>
            );
        })}
    </div>
    );
}

export default List;
